import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const Partnership = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    lookingFor: "",
  });

  const handleSearch = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-teal-50 to-white">
      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-6 left-6 p-2 text-teal-600 hover:text-teal-800 transition-colors"
      >
        <svg
          className="w-6 h-6"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="max-w-4xl mx-auto pt-20 px-4 sm:px-6 lg:px-8">
        {/* 标题部分 */}
        <div className="text-center mb-12">
          <h1 className="text-4xl font-bold text-gray-900 mb-4">
            Let's Find Your Perfect Partner
          </h1>
          <p className="text-lg text-gray-600">
            Connect with organizations that share your values and mission
          </p>
        </div>

        {/* 搜索表单 */}
        <form
          onSubmit={handleSearch}
          className="space-y-6 bg-white rounded-xl shadow-lg p-8"
        >
          <div className="grid grid-cols-1 gap-6 md:grid-cols-2">
            {/* Location */}
            <div className="col-span-1">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Location
              </label>
              <input
                type="text"
                className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition duration-150"
                placeholder="Enter location"
                value={searchParams.location}
                onChange={(e) =>
                  setSearchParams({ ...searchParams, location: e.target.value })
                }
              />
            </div>

            {/* Organization Type */}
            <div className="col-span-1">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Organization Type
              </label>
              <select
                className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition duration-150"
                value={searchParams.orgType}
                onChange={(e) =>
                  setSearchParams({ ...searchParams, orgType: e.target.value })
                }
              >
                <option value="">Select type</option>
                <option value="nonprofit">Nonprofit</option>
                <option value="corporate">Corporate</option>
                <option value="government">Government</option>
                <option value="education">Education</option>
              </select>
            </div>
          </div>

          {/* What Kind of Organization Are You Looking For */}
          <div className="col-span-2">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              What Kind of Organization Are You Looking For?
            </label>
            <textarea
              className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition duration-150"
              rows="4"
              placeholder="Describe your ideal partner organization..."
              value={searchParams.lookingFor}
              onChange={(e) =>
                setSearchParams({ ...searchParams, lookingFor: e.target.value })
              }
            />
          </div>

          {/* Search Button */}
          <div className="flex justify-center">
            <button
              type="submit"
              className="px-8 py-3 bg-teal-600 text-white rounded-lg hover:bg-teal-700 focus:outline-none focus:ring-2 focus:ring-teal-500 focus:ring-offset-2 transition duration-150"
            >
              Find Partners
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Partnership;
